import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 24.2-807 Contest only on complaint of unsuccessful party; contents of complaint.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-807.md","filePath":"vacode/24.2-807.md"}'),a={name:"vacode/24.2-807.md"},c=n('<h1 id="§-24-2-807-contest-only-on-complaint-of-unsuccessful-party-contents-of-complaint" tabindex="-1">§ 24.2-807 Contest only on complaint of unsuccessful party; contents of complaint. <a class="header-anchor" href="#§-24-2-807-contest-only-on-complaint-of-unsuccessful-party-contents-of-complaint" aria-label="Permalink to &quot;§ 24.2-807 Contest only on complaint of unsuccessful party; contents of complaint.&quot;">​</a></h1><p>The provisions of this section and §§ <a href="http://law.lis.virginia.gov/vacode/24.2-808/" target="_blank" rel="noreferrer">24.2-808</a> through <a href="http://law.lis.virginia.gov/vacode/24.2-813/" target="_blank" rel="noreferrer">24.2-813</a> govern contests conducted pursuant to §§ <a href="http://law.lis.virginia.gov/vacode/24.2-805/" target="_blank" rel="noreferrer">24.2-805</a> and <a href="http://law.lis.virginia.gov/vacode/24.2-806/" target="_blank" rel="noreferrer">24.2-806</a>. The contest shall be initiated only by a written complaint of one or more of the unsuccessful candidates. The complaint shall contain (i) objections to the eligibility of the contestee based on specific allegations, (ii) objections to the conduct or results of the election accompanied by specific allegations which, if proven true, would have a probable impact on the outcome of the election, or (iii) both.</p><p>In an election of electors for the President and Vice President of the United States, the presidential candidate shall represent the vice presidential candidate and slate of electors and be the party to the contest for purposes of this article.</p><p>Code 1950, §§ 24-430, 24-432; 1970, c. 462, § 24.1-240; 1973, c. 30; 1981, c. 570; 1993, c. 641.</p>',4),i=[c];function s(r,l,p,f,d,h){return t(),o("div",null,i)}const m=e(a,[["render",s]]);export{_ as __pageData,m as default};
